      def self.parse(data)
        data = data.dup.force_encoding(Encoding::ASCII_8BIT) if data.respond_to?(:force_encoding)

        address_list = AddressListStruct.new([], [])
        return address_list if Mail::Utilities.blank?(data)

        phrase_s = phrase_e = qstr_s = qstr = comment_s = nil
        group_name_s = domain_s = group_name = nil
        local_dot_atom_s = local_dot_atom_e = nil
        local_dot_atom_pre_comment_e = nil
        obs_domain_list_s = nil

        address_s = 0
        address = AddressStruct.new(nil, nil, [], nil, nil, nil, nil)

        # 5.1 Variables Used by Ragel
        p = 0
        eof = pe = data.length
        stack = []

        begin
          p ||= 0
          pe ||= data.length
          cs = start
          top = 0
        end

        begin
          testEof = false
          _slen, _trans, _keys, _inds, _acts, _nacts = nil
          _goto_level = 0
          _resume = 10
          _eof_trans = 15
          _again = 20
          _test_eof = 30
          _out = 40
          while true
            if _goto_level <= 0
              if p == pe
                _goto_level = _test_eof
                next
              end
              if cs == 0
                _goto_level = _out
                next
              end
            end
            if _goto_level <= _resume
              _keys = cs << 1
              _inds = _index_offsets[cs]
              _slen = _key_spans[cs]
              _wide = data[p].ord
              _trans = if (_slen > 0 &&
                           _trans_keys[_keys] <= _wide &&
                           _wide <= _trans_keys[_keys + 1])
                         _indicies[_inds + _wide - _trans_keys[_keys]]
                       else
                         _indicies[_inds + _slen]
                       end
              cs = _trans_targs[_trans]
              if _trans_actions[_trans] != 0
                case _trans_actions[_trans]
                when 16
                  begin
                    phrase_s ||= p
                  end
                when 4
                  begin
                    phrase_e = p - 1
                  end
                when 8
                  begin
                    qstr_s = p
                  end
                when 10
                  begin
                    qstr = chars(data, qstr_s, p - 1)
                  end
                when 78
                  begin
                    comment_s = p unless comment_s
                  end
                when 12
                  begin
