                        else
                          if p == eof
                            address.local = chars(data, local_dot_atom_s, local_dot_atom_pre_comment_e)
                          else
                            skip = true
                          end
                        end
                      end
                      unless skip
                        address.raw = chars(data, address_s, p - 1)
                        address_list.addresses << address if address

